('Bonesteed of Oblivion', '|cFFFFD200World Event:|r WoW Remix: Legion', 'A good warhorse is loyal to its bones. Having shed its mortal coil, this steed is an omen of scarcity and death.', 2683, 230, 64, 6, 1251311, 0, 0, 45, 0, 0, 63906),
('Bonesteed of Plague', '|cFFFFD200World Event:|r WoW Remix: Legion', 'A good warhorse is loyal to its bones. Having shed its mortal coil, this steed is an omen of sickness and suffering.', 2682, 230, 64, 6, 1251309, 0, 0, 45, 0, 0, 63906),
('Bonesteed of Bloodshed', '|cFFFFD200World Event:|r WoW Remix: Legion', 'A good warhorse is loyal to its bones. Having shed its mortal coil, this steed is an omen of eternal strife.', 2681, 230, 64, 6, 1251307, 0, 0, 45, 0, 0, 63906),
('Bonesteed of Triumph', '|cFFFFD200World Event:|r WoW Remix: Legion', 'A good warhorse is loyal to its bones. Having shed its mortal coil, this steed is an omen of bold conquest.', 2679, 230, 64, 6, 1251305, 0, 0, 45, 0, 0, 63906),
('Cobalt Phase-Hunter', '|cFFFFD200Promotion:|r Burning Crusade Classic', 'Due to the otherworldly energies that irradiated Draenor, these creatures can shift through space at will. As such, they are rarely seen... until it is too late.', 2732, 230, 0, 7, 1256677, 0, 0, 4, 0, 0, 63906),
('Brewfest Bomber', '|cFFFFD200Drop:|r Coren Direbrew|n|cFFFFD200Holiday:|r Brewfest', 'Careful not to consume the ammunition.', 2640, 424, 1024, -1, 1247662, 0, 0, 4, 0, 0, 63906),
('Lana\'thel\'s Crimson Cascade', '|cFFFFD200In-Game Shop|r ', 'The Blood Queen\'s mastery of the sanguine arts allowed her to conjure a fearsome servant to bear her into battle. Adorned in livery suited to her court, it is masked with a fearsome visage, and adorned with wings and claws to bring to mind its master\'s wrath.', 2566, 424, 0, 9, 1233925, 0, 0, 4, 0, 0, 63906);
