INSERT INTO `ui_splash_screen` (`ID`, `Header`, `TopLeftFeatureTitle`, `TopLeftFeatureDesc`, `BottomLeftFeatureTitle`, `BottomLeftFeatureDesc`, `RightFeatureTitle`, `RightFeatureDesc`, `AllianceQuestID`, `HordeQuestID`, `ScreenType`, `TextureKitID`, `SoundKitID`, `PlayerConditionID`, `CharLevelConditionID`, `RequiredTimeEventPassed`, `VerifiedBuild`) VALUES
(85, 'New in Patch 11.2.0!', 'Ecological Succession', 'Help Ve\'nari by collecting creatures across Azeroth to restore life to K\'aresh.', 'Eco-dome Al\'dani', 'Defend the hidden eco-dome and unravel the ancient secrets sealed within!', 'K\'aresh', 'Dive into the dark secrets of the void on the lost planet of the Ethereals.', 84956, 84956, 0, 5725, 0, 0, 104814, 1116, 63906),
(84, 'New in Patch 11.1.7!', 'Lorewalking', 'Speak with Lorewalker Cho in a capital city for a renewed questing experience through iconic lore moments!', 'Combat Assistant', 'Get assistance with your combat rotation by enabling this feature in the Settings menu!', 'Delves: Overcharged!', 'Power up with Titan machinery to explore new depths and face new challenges.', 0, 0, 0, 5714, 0, 0, 104814, 1350, 63906),
(80, 'New in Patch 11.1.5!', 'Cooldown Manager', 'Track your cooldowns by enabling this feature in the Settings menu!', 'Coming Soon: Dastardly Duos', 'Battle a duo of foes from Azeroth\'s past and try for a high score!', 'Horrific Visions Revisited', 'Return to the depths of madness to experience new challenges and earn new rewards!', 86706, 86706, 0, 5703, 0, 134417, 104814, 1095, 63906),
(76, 'New in Patch 11.1.0!', 'D.R.I.V.E.', 'Experience a new way to travel in Undermine with the customizable G-99 Breakneck!', 'Customize your Campsite', 'Create new camps in the Character Select Screen and pick from a set of unlockable backgrounds!', 'Undermine', 'Continue the pursuit of Xal\'atath and confront Gallywix\'s forces in the sprawling city streets of Undermine.', 0, 0, 0, 5686, 0, 0, 104814, 1057, 63906),
(73, 'New in Season 1!', 'Season 1 Begins', 'Earn rewards in Mythic dungeons and the new Rated Battleground Blitz!', 'Nerub-ar Palace', 'Assault the seat of Queen Ansurek\'s power within Azj-Kahet.', 'Zekvir\'s Lair', 'Progress in new Seasonal Delve content to unlock Zekvir\'s Lair.', 84224, 84224, 0, 5651, 0, 0, 104814, 574, 63906),
(72, 'New in The War Within!', 'Delves', 'Dive deep into Delves, unravel mysteries, and seek treasure.', 'Hero Talents', 'Expand your class fantasy and customize your talent build!', 'The War Within', 'Travel to Khaz Algar and heed the call of the Radiant Song!', 0, 0, 0, 5632, 0, 0, 104814, 606, 63906),
(71, 'New in The War Within Pre-Patch!', 'Radiant Echoes', 'Vanquish foes from Azeroth\'s past as memories resurface. Available July 30th!', 'The War Within Coming Soon', 'Launches August 26 (Early Access August 22).', 'Warbands', 'Your characters share access to a Warbands bank, Dragonflight reputations, and more!', 0, 0, 0, 5624, 0, 0, 104814, 705, 63906),
(70, 'New in 10.2.7', 'Draenei and Troll Heritage', 'Collect distinctive armor sets while exploring their cultures and histories.', 'Pandaria Remixed', 'A wild way to level starts next week!', 'Harbinger of Darkness', 'As peace returns to the Dragon Isles, a dark plan is set in motion.', 0, 0, 1, 5583, 0, 0, 104814, 582, 63906),
(69, '10.2.7 Mists of Pandaria: Remix', 'Earn Account Rewards', 'Collect Bronze to earn mounts, pets, and appearances!', 'Get Started', 'Create a new Timerunner on the character select screen.', 'Mists of Pandaria: Remix', 'Experience a wild new twist to the Mists of Pandaria!', 0, 0, 1, 5582, 0, 0, 104814, 570, 63906),
(68, '', 'Earn Rewards', 'Collect Plunder to earn rewards such as mounts, pets, and transmogs!', 'Get Started', 'To play, log out and select Plunderstorm on the character select screen.', 'Plunderstorm', 'Pirates clash in a grand battle royale!', 0, 0, 0, 5572, 0, 0, 104814, 587, 63906),
(64, 'New in Season 4!', 'Dragonflight Season 4', 'Earn new rewards.', 'Updated Dungeon Progression', 'Heroic, Mythic, and Mythic+ difficulty and rewards reworked.', 'Awakened Raids', 'Conquer all three Dragonflight raids for updated rewards!', 0, 0, 1, 5566, 0, 0, 104738, 353, 63906),
(63, 'New in 10.2.5!', 'Azerothian Archives', 'Dive into the lost lore and legends of the Dragon Isles.', 'Follower Dungeons', 'Queue up for Dragonflight dungeons with NPC followers!', 'Gilneas Reclaimed', 'Join Genn Greymane and the Gilneans as they retake their homeland.', 78596, 78597, 0, 5548, 0, 0, 104814, 535, 63906),
(61, 'New in Patch 10.2.0!', 'Dream Guardians', 'Join the defense of the dream with a new renown, events, and rewards.', 'Battleground Blitz', 'Join an 8v8 solo queue Battleground experience and in this mode, everything goes fast!', 'The Emerald Dream', 'Enter the dream and defend the blooming world tree Amirdrassil from Fyrakk and the Druids of the Flame.', 0, 0, 0, 5553, 0, 0, 104814, 470, 63906),
(60, 'New in Patch 10.1.7!', 'Night Elf and Forsaken Heritage', 'Collect distinctive armor sets as you explore these races\' cultures and histories.', 'Introducing the Ping System', 'Visit the Options Menu to start communicating faster with pings.', 'Dreamsurges', 'Battle dream-empowered foes across the Dragon Isles as Amirdrassil prepares to bloom!', 0, 0, 0, 5548, 0, 0, 104814, 422, 63906),
(59, 'New in Patch 10.1.5!', 'Augmentation Unlocked', 'A new damage specialization with a unique support-based playstyle!', 'Unravelling Timeways', 'Support the Bronze Dragonflight in Eon\'s Fringe and Time Rifts!', 'Dawn of the Infinite', 'Battle the Infinite Dragonflight in a mythic mega-dungeon!', 0, 0, 0, 5540, 0, 0, 104814, 379, 63906),
(58, 'New in Season 2!', 'Dragonflight Season 2', 'Earn new rewards in Mythic Keystone dungeons and PvP', 'Mythic+ Refresh', 'Experience new affixes and a refreshed Mythic+ pool of dungeons!', 'Aberrus, the Shadowed Crucible', 'Pursue Sarkareth and explore the legacy of Neltharion in this ancient laboratory.', 0, 0, 1, 5533, 0, 0, 104738, 294, 63906),
(57, 'New in Patch 10.1.0!', 'Winding Slitherdrake', 'Race through Zaralek Cavern on the new native dragonriding mount!', 'Cross Faction Guilds', 'For the first time, Horde and Alliance players can unite in the same guild!', 'Zaralek Cavern', 'Continue the story of the Sundered Flame and confront the Incarnates\' forces in this forgotten underground expanse.', 72975, 72975, 0, 5532, 0, 0, 104814, 364, 63906),
(56, 'New in 10.0.7!', 'Human and Orc Heritage', 'Collect distinctive armor sets as you explore these races\' cultures and histories.', 'Recruit-A-Friend Update', 'Exciting new rewards for bringing your friends to Azeroth!', 'Return to the Forbidden Reach', 'Delve into the mysteries of the dracthyr left behind during their escape.', 74381, 74381, 0, 5514, 0, 0, 104814, 362, 63906),
(55, 'New in Patch 10.0.5!', 'The Storm\'s Fury', 'Battle against the Primalists within the Primalist Future for epic rewards.', 'Transmogrification Updates', 'White and gray items can now be collected for transmog!', 'Trading Post, Open for Business!', 'A new shop for cosmetics is now open in Stormwind and Orgrimmar.', 0, 0, 0, 5529, 0, 0, 104814, 343, 63906),
(50, 'New in Season 1!', 'PvP Season 1', 'Earn rewards with the new Rated Solo Shuffle mode.', 'Mythic+ Season 1', 'A new dungeon rotation and the \"Thundering\" affix await.', 'Vault of the Incarnates', 'Stop the Primalists from releasing Raszageth\'s imprisoned kin.', 0, 0, 0, 5492, 0, 0, 104738, 260, 63906),
(49, 'New in Dragonflight!', 'Professions Update', 'New features including crafting orders, equipment, specializations, and more!', 'Dragonriding', 'Soar through the Dragon Isles\' skies with a thrilling new movement system!', 'Dragon Isles', 'Travel to the ancestral home of the dragonflights and help them reclaim their legacy.', 67700, 65444, 0, 5484, 0, 0, 104813, 254, 63906);
